query_sparql:
PREFIX cowl: <https://w3id.org/scholarlydata/ontology/conference-ontology.owl#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX dc: <http://purl.org/dc/elements/1.1/>
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

SELECT DISTINCT ?person
WHERE {
  ?paper a cowl:InProceedings ;
         dc:creator ?person .
  OPTIONAL { ?paper cowl:title ?title . }
  OPTIONAL { ?paper cowl:abstract ?abstract . }
  FILTER(
    (BOUND(?title) && CONTAINS(LCASE(?title), "deep learning"))
    ||
    (BOUND(?abstract) && CONTAINS(LCASE(?abstract), "deep learning"))
  )
}

