SELECT DISTINCT ?person
WHERE {
  ?person a cowl:Person .
  OPTIONAL { ?person cowl:hasAffiliation ?aff . }
  OPTIONAL { ?aff cowl:withOrganisation ?org . }
  OPTIONAL { ?org cowl:name ?orgName . }
  FILTER(
    BOUND(?orgName)
    && CONTAINS(LCASE(?orgName), "university of vienna")
  )
}

